CREATE TABLE Carrier (
  id SERIAL PRIMARY KEY NOT NULL,
  name VARCHAR(100)
);

CREATE TABLE Trains (
  id text PRIMARY KEY ,
  name VARCHAR(100),
	cars numeric(3)
);

CREATE Table Car(
	number_of_car integer not null,
  train_id text REFERENCES Trains(id) on delete cascade,
	type varchar(50),
	sections integer,
	class numeric(2),
	PRIMARY KEY(number_of_car, train_id)
);

CREATE TABLE Seat(
	number_of_seat integer not null,
train_id text references Trains(id) on delete cascade,
	type_of_seat varchar(20),
	PRIMARY KEY(number_of_seat, train_id)
);

CREATE TABLE Discounts (
  type VARCHAR(100) PRIMARY KEY ,
  amount NUMERIC(3)
);

CREATE TABLE "User" (
  id SERIAL PRIMARY KEY,
  name VARCHAR(20),
  surrname VARCHAR(50),
  email VARCHAR(100) unique,
  phone_number varchar(11)
);

ALTER TABLE "User" ALTER COLUMN email SET NOT NULL ;

CREATE TABLE Station (
  id SERIAL PRIMARY KEY ,
  name VARCHAR(100)
);

CREATE TABLE Line (
  id SERIAL PRIMARY KEY,
  train_id text references Trains(id),
  --departure_time TIMESTAMP,
  --arrival_time TIMESTAMP CHECK (departure_time < Line.arrival_time),
  carrier_id INT REFERENCES Carrier(id)
);

CREATE TABLE Platforms (
  "number" NUMERIC(2),
  station_id INTEGER REFERENCES Station(id) on delete cascade,
  first_track boolean,
  second_track boolean,
  PRIMARY KEY ("number",station_id)
);

CREATE TABLE Trip (
  line_id INTEGER REFERENCES Line(id) on delete cascade,
  current_station_id INTEGER REFERENCES Station(id),
  arrival_time interval,
  departure_time interval,
	platform_nr integer,
	track	integer,
	FOREIGN KEY (platform_nr, current_station_id) references Platforms("number", station_id),
	unique( line_id, current_station_id)
);


CREATE TABLE Ticket (
  id SERIAL PRIMARY KEY,
  user_id INT REFERENCES "User"(id) on delete cascade,
  line_id INT REFERENCES Line(id) on delete cascade,
  departure_date date,
  departure_station integer references Station(id) on delete cascade,
  arrival_station integer references Station(id) on delete cascade,
  seat_number int,
  discount_type VARCHAR(100) REFERENCES Discounts(type),
  order_date date
);

CREATE TABLE Trip_Interval (
  line_id INTEGER PRIMARY KEY REFERENCES Line(id) on delete cascade,
  start_date date,
  end_date date CHECK (start_date < end_date),
  trip_interval INTERVAL
);


CREATE or REPLACE RULE check_car AS ON INSERT TO Car WHERE new.number_of_car > ( SELECT cars from trains where id = new.train_id )
DO INSTEAD NOTHING;

