CREATE OR REPLACE FUNCTION find_line(day TIMESTAMP, dep_station VARCHAR(100), arr_station VARCHAR(100))
  RETURNS TABLE(line_id INTEGER)--, departue INTEGER,arrival INTEGER)
  AS $$
  DECLARE
  dep_id INTEGER;
  arr_id INTEGER;
  BEGIN
    dep_id = (SELECT id FROM station WHERE dep_station = name);
    arr_id = (SELECT id FROM station WHERE arr_station = name);
    RETURN QUERY SELECT t1.line_id--,  t1.current_station_id as dep, t2.current_station_id as arr
      FROM Trip t1 JOIN Trip t2 ON t1.line_id=t2.line_id
      WHERE t1.current_station_id = dep_id AND t2.current_station_id = arr_id
            AND (day - INTERVAL '3 hours',day + INTERVAL '3 hours') OVERLAPS (day::DATE + t1.arrival_time,day::DATE + t1.arrival_time)
            AND t1.arrival_time < t2.arrival_time
      GROUP BY t1.line_id ;
    END
  $$
  LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION timetable(T TIMESTAMP,"from" VARCHAR(100),"to" VARCHAR(100))
  returns TABLE(line INTEGER, train_id text,dep_time INTERVAL,arr_time INTERVAL)
AS $$
  DECLARE
    dep_id INTEGER;
    arr_id INTEGER;
  BEGIN


    dep_id = (SELECT id FROM station WHERE "from" = name);
    arr_id = (SELECT id FROM station WHERE "to" = name);
    RETURN QUERY (SELECT line_id,E.train_id,E.departure_time,arrival_time FROM
            (SELECT B.id ,B.train_id,departure_time FROM
          (SELECT line.id,line.train_id FROM find_line(T,"from","to")
          LEFT JOIN line ON (line_id = line.id)) AS B
      LEFT JOIN trip ON
      (B.id = line_id AND current_station_id = dep_id)) AS E LEFT JOIN trip
      ON E.id = line_id AND current_station_id = arr_id) ORDER BY 3,4;
  END
$$
  LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION which_car( seat_nr int, line_id int )
returns integer AS $$
declare
	suma int;
	temp text;
	i int;
	tr_id text;
begin
	i = 1;
	suma = 0;
	tr_id = (select train_id from line where id = line_id );
	while true loop
		temp = (select "type" from car where train_id = tr_id and number_of_car = i);
		if temp = 'Wagon z przedziałami' then
			suma = suma + 24;
		elsif temp = 'Wagon bez przedziałów' then
			suma = suma + 18;
		else
			suma = suma + 12;
		end if;
		if suma >= seat_nr then
			return i;
		end if;
		i = i + 1;
	end loop;
end
$$ language plpgsql;

CREATE OR REPLACE FUNCTION basic_price(line INTEGER, "from" INTEGER,"to" INTEGER)
  RETURNS NUMERIC(6,2)
  AS $$
  DECLARE
    out numeric(6,2);
    second INTERVAL;
    first INTERVAL;
  BEGIN
    second = (SELECT arrival_time FROM Trip WHERE line_id = line AND "to" = current_station_id);
    first = (SELECT departure_time FROM Trip WHERE line_id = line AND "from" = current_station_id);
    out = cast ((SELECT 3 +  (( 60 * extract(HOUR from second) + extract(MINUTE FROM second)- 60 * extract(HOUR FROM first) - extract(MINUTE FROM first)))/10) as numeric(6,2));
	--do dodania 24godziny w niektórych miejscach bo cena wychodzi ujemna
    RETURN out;
  END

  $$
  LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION calculate_price( depSt int, arrSt int, discount varchar(100), seat_nr int, line_id int )
returns numeric(6,2) AS $$
declare
	basic numeric(6,2);
	car_nr int;
	tr_id text;
begin
	tr_id = (select train_id from line where id = line_id );
	basic = basic_price( line_id, depSt, arrSt );
	car_nr = which_car( seat_nr, line_id );
	if (select "class" from car where train_id = tr_id and number_of_car = car_nr ) = 1 then
		basic = basic * 1.3;
	end if;
	if discount is not null then
		basic = basic * (100 - (select amount from discounts where "type" = discount))* 0.01;
	end if;
	return basic;
end
$$
language plpgsql;

CREATE or replace FUNCTION check_all() RETURNS trigger AS $check_all$
BEGIN
	  if (select "User".id from "User" where new.user_id = "User".id) is null then
			return null;
	  elsif (select line.id from line where new.line_id = line.id ) is null then
			return null;
	  elsif (new.departure_date < (select start_date from  trip_interval where line_id = new.line_id )) then
			return null;
	  elsif (new.departure_date > (select end_date from  trip_interval where line_id = new.line_id )) then
			return null;
	  elsif calculate_price( new.departure_station, new.arrival_station, new.discount_type, new.seat_number, new.line_id ) < 0 then
			return null;
	  else
		return new;
	  end if;
END
$check_all$ LANGUAGE plpgsql;

CREATE TRIGGER check_all BEFORE INSERT ON Ticket
FOR EACH ROW EXECUTE PROCEDURE check_all();

CREATE OR REPLACE VIEW ticketView AS SELECT t.*,(t.departure_date + (select departure_time from trip q where t.line_id = q.line_id and q.current_station_id = t.departure_station )) as "departure_time",
 (t.departure_date + (select arrival_time from trip q where t.line_id = q.line_id and q.current_station_id = t.arrival_station )) as "arrival_time",
	calculate_price( t.departure_station, t.arrival_station, t.discount_type, t.seat_number, t.line_id) as "price" from ticket t;

