CREATE OR REPLACE function after_delete_station() returns trigger as $after_delete_station$
begin
	delete from ticket where departure_station = old.id or arrival_station = old.id;
	delete from trip where current_station_id = old.id;
	return old;
end
$after_delete_station$ language plpgsql;

create trigger after_delete_station after delete on station
for each row execute procedure after_delete_station();

CREATE OR REPLACE function after_delete_trip() returns trigger as $after_delete_trip$
begin
	delete from ticket where (departure_station = old.current_station_id and line_id = old.line_id) or (arrival_station = old.current_station_id and line_id = old.line_id);
	return old;
end
$after_delete_trip$ language plpgsql;

create trigger after_delete_trip after delete on trip
for each row execute procedure after_delete_trip();

CREATE OR REPLACE function after_delete_discount() returns trigger as $after_delete_discount$
begin
	update ticket set discount_type = null;
	UPDATE ticketView SET price =  calculate_price( departure_station, arrival_station, null, seat_number,line_id) where discount_type = old."type";
	return old;
end
$after_delete_discount$ language plpgsql;

create or replace function before_insert_trip() returns trigger as $before_insert_trip$
declare
      trips record;
begin
	  if (select id from station where new.current_station_id = id) is null then
			return null;
		end if;

      for trips in select * from trip where new.line_id = line_id loop
			if trips.arrival_time = new.arrival_time or trips.departure_time = new.departure_time then
				return null;
			end if;
      end loop;
	  return new;
end
$before_insert_trip$ language plpgsql;

create trigger before_insert_trip before insert on trip
for each row execute procedure before_insert_trip();


create or replace function tracks_on_station(station integer)
returns integer as $$
declare
	perons record;
	ret int;
begin
	ret = 0;
	for perons in select * from platforms where station_id = station loop
		if perons.first_track = true then
			ret = ret + 1;
		end if;
		if perons.second_track = true then
			ret = ret + 1;
		end if;
	end loop;
	return ret;
end
$$
language plpgsql;

CREATE Or replace function first_free_track(station int, timee interval)
returns table( platform_nr integer, track_nr integer )
as $$
declare
	a int;
	temp int;
begin
	temp = ( select count(line_id) from trip where arrival_time = timee and current_station_id = station and trip.platform_nr is not null ) ;
	if tracks_on_station(station) = temp then
		return query(SELECT 0,0);
	elsif tracks_on_station(station) = 8 then
		if (temp % 2 = 0 ) then
			a = temp/2;
			return query(SELECT a+1, 1);
		else
			a = (temp+1)/2;
			return query(SELECT a, 2);
		end if;
	else
		if temp < 2 then
			return query(SELECT 1,temp+1);
		else
			if (select first_track from platforms where station_id = station and "number" = 2) = true then 
				return query(SELECT 2,2);
			else 
				return query(SELECT 2,1);
			end if;
		end if;
	end if;
end
$$
language  plpgsql;

CREATE or replace FUNCTION give_track() RETURNS trigger AS $give_track$
declare
	temp record;
BEGIN
	temp = first_free_track(new.current_station_id, new.arrival_time);
	if ((temp.platform_nr != 0) and ((select 1 from platforms where station_id = new.current_station_id and "number" = temp.platform_nr) is not null)) then 	
		UPDATE Trip set platform_nr = temp.platform_nr, track = temp.track_nr where line_id = new.line_id and current_station_id = new.current_station_id;
	else 
		temp = first_free_track(new.current_station_id, new.arrival_time+ '1 minute');
		UPDATE Trip set arrival_time = arrival_time + '1 minute', platform_nr = temp.platform_nr, track = temp.track_nr where line_id = new.line_id and current_station_id = new.current_station_id;
	end if;
	
	return new;
END
$give_track$ LANGUAGE plpgsql;

CREATE TRIGGER give_track AFTER INSERT ON Trip
FOR EACH ROW EXECUTE PROCEDURE give_track();















